import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for page to fully load
    await page.waitForSelector('.header', { timeout: 10000 });
    await page.waitForSelector('.video-grid', { timeout: 10000 });

    // Click on Trending navigation item
    await page.click('[data-page="trending"]');
    await page.waitForSelector('.page-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_trending.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_trending.png'));

    // Perform a search
    await page.fill('.search-input', 'cooking');
    await page.click('.search-btn');
    await page.waitForSelector('.search-header', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search.png'));

    // Click on a search result
    await page.click('.search-result-item:first-child');
    await page.waitForSelector('.video-player-container', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_video.png'));

    // Interact with video player
    await page.click('.play-button-overlay');
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_playing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_playing.png'));

    // Like the video
    await page.click('.like-btn');
    await page.waitForTimeout(500);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_liked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_liked.png'));

    // Navigate back to home using logo
    await page.click('.logo');
    await page.waitForSelector('.video-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_7_home.png') });
    screenshots.push(path.join(screenshotsDir, 'step_7_home.png'));

    // Extract some data for verification
    const videoCount = await page.$$eval('.video-item', items => items.length);
    const trendingVideos = await page.$$eval('.video-title', titles => 
        titles.slice(0, 3).map(t => t.textContent.trim())
    );

    return {
      success: true,
      action: "Successfully navigated YouTube clone interface, performed search, watched video, and returned home",
      extractedData: {
        videoCount,
        trendingVideos
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete YouTube navigation task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Trending navigation item
    await page.waitForSelector('[data-page="trending"]');
    await page.click('[data-page="trending"]');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_trending_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_trending_page.png'));

    // Wait for and click on first video in trending
    await page.waitForSelector('.video-item');
    await page.click('.video-item:first-child');
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_video_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_video_page.png'));

    // Extract video title and channel name
    const videoTitle = await page.$eval('.video-title', el => el.textContent.trim());
    const channelName = await page.$eval('.channel-name', el => el.textContent.trim());

    // Like the video if not already liked
    const likeButton = await page.$('.like-btn');
    const isLiked = await likeButton.evaluate(el => el.classList.contains('active'));

    if (!isLiked) {
      await likeButton.click();
      await page.waitForTimeout(1000);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_4_liked_video.png') });
      screenshots.push(path.join(screenshotsDir, 'step_4_liked_video.png'));
    }

    // Add a comment
    await page.waitForSelector('.comment-input');
    await page.click('.comment-input');
    await page.type('.comment-input', 'Great video! Very informative.');
    await page.click('.comment-submit');
    await page.waitForTimeout(2000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_comment_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_comment_added.png'));

    return {
      success: true,
      action: "Successfully navigated YouTube clone, liked a video and added a comment",
      extractedData: {
        videoTitle,
        channelName,
        liked: !isLiked,
        commentAdded: true
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete YouTube interaction task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

